& .upload-file-error{
  color: #FF0000;
  font-family: 'Calibri';
  font-size: 9pt;
  font-style: normal;
  font-weight: 400;
}

& table.MuiTable-root tr th:first-child, table.MuiTable-root tr td:first-child {
    width: 110px !important;
}

/** Table Card Style **/
.table-card .MuiPaper-outlined {
  box-shadow: 0rem 0.313rem 0.625rem rgb(0 0 0 / 25%);
  border: 0rem;
  border-radius: 0 0 0.38em 0.38em;
  overflow-x: auto;
  
}

/** Table Header Style **/
.table-head .MuiTypography-subtitle1 {
 
  font-weight: 700;
  background-color: #ccc;
} 

& th {

  font-style: normal;
  font-weight: 700;
 
  background-color: #ccc;
 
}



/** Table Body Style **/
.table-body .MuiTableCell-body {
  padding: 0.2rem;
 
}

& tr:nth-child(2n) {
  background-color: rgb(242, 242, 242);
}

& tr {
  background-color: #FAFAFA;
}

& tbody :hover {
  background-color: #DDDDDD;
}

& td {
  border-bottom: 0rem;
}

& td:first-child {
  padding-left: 2.2em;
}

& .MuiInputBase-input {
  text-align: left;
  color: #000000;
  line-height: 0.94em;
  font-style: normal;
  font-weight: 400;
  font-size: 9pt;
  padding-left: 0.5em;
}

& .MuiInputBase-input:hover {
  background-color: transparent;
}

& .MuiButton-label {
  color: #E64E00;
  font-family: Calibri, san-serif !important;
  font-style: normal;
  font-weight: 400;
  font-size: 0pt;
  line-height: 0.94em;
  padding: 0.5rem;
}    

& .MuiButton-label::before{
  content:'View';
  font-size: 9pt;
}

/** Table Footer Style **/
& tfoot tr {
  background-color: #E5E5E5;
}

& tfoot td {
  padding: 0rem;
}

/** Pagination Style **/
& .MuiTypography-caption {
  font-family: Calibri, san-serif !important;
  font-style: normal;
  font-weight: 400;
  font-size: 12pt;
  line-height: 1.25em;
  color: #694F7A;
}

& .MuiSelect-select {
  min-width: 1.5em;
  font-size: 12pt;
  color: #694F7A;
  min-height: 1em;
  margin-top: 0.28em;
}

/** Sort Icon Style **/
& th .MuiSvgIcon-root {
  font-size: 1.7em;
}

/*& {*/
/*  margin-top:20px;*/
/*}*/
& * {
      font-family: 'Inter' !important;
    font-size: 13px;
    font-weight: 500;
    line-height: 20px;
     color: #00287B;
  }

& .cs-html-field-container{
  width: 100%;
}
.coverageCard {
  padding-left: unset;
}
.coverageCard .card-body {
  padding: 0;
}
.coverageCard .content.collapse.show {
  padding-left: unset;
}
.coverageCard .cover-table-border, .coverageCard .cover-table-border:hover {
  padding: 0 0 0 0px;
  background: 0% 0% no-repeat padding-box padding-box #fff;
  border: 1px solid #b4babf;
  border-radius: 0.5rem;
  border-collapse: unset;
  color: #182330;
}

.coverageCard #coverSelectionSection {
  box-shadow: unset;
  padding-bottom: unset;
  margin-bottom: 0.95rem;
}

.coverageCard .plan-detail-final-row {
  font-weight: bold;

}

.table {
  width: 100%;
  margin:-2px
 
}

.table td, .table th {
  padding: 0.75rem;
  vertical-align: top;
  border-top: 1px solid #dee2e6;
   
}

.coverageCard .plan-details .card-title{
  padding-bottom: 1rem;
  display: block;
  text-align: left;
  font-weight: 600;
   font-size: 18px;
   line-height: 22px;
   color: #00287B;

}
& thead tr td{
 
    background: #E6EAF2;
    color: #01133A;
    font-weight: 600;
}
& thead tr td:first-child{
 border-top-left-radius:0.5rem
}
& thead tr td:last-child{
 border-top-right-radius:0.5rem
}



@media (max-width: 767px) {
  .coverageCard {
    padding: unset;
    max-width: 100vw;
    overflow: auto;
 }
}

@media (min-width: 768px) {
  .coverageCard .plan-details {
    color: #22293a;
  }
  .coverageCard .plan-details thead {
    color: #b4babf;
  }
  .coverageCard .plan-details thead td {
    border: none;
  }
  .coverageCard .plan-details :hover {
    /*background: unset;*/
    outline: none;
  }
}

& .plan-detail-final-row td{
  font-weight: bold;
  
}

